Based on Mexico's current criminal climate, EL C RTEL is a rare look into the values and practices of the world's most intriguing and enigmatic industry - the multi-billion dollar business of drug trafficking. When Jules Land, a na ve business journalist, approaches Mexico's most notorious drug cartel and requests an audience with its leader, a one-time-priest turned murderous cutthroat, he quickly realizes he's in over his head. Wanting only the chance to kick-start his struggling career, Jules goes from seeking to understand the principles behind The Cartel's success, to fighting to return home with his wits - and his life - intact.
